wiki /playerclient add... 指定したプレイヤーをconfigに保存する。スポーンする座標、顔の向き、スポーンするディメンション、ゲームモードも合わせて指定して保存できる。 /playerclient add [name] spawn at [x] [y] [z] facing [yaw] [pitch] in [dimension] in [gamemode] /playerclient add [name] spawn here in [gamemode] /playerclient remove... 指定したプレイヤーをconfigから削除する。 /playerclient remove [name] /playerclient spawn... configに保存されたプレイヤーを指定してスポーンさせる。保存されている座標からのオフセットを指定してその座標にスポーンさせることもできる。 /playerclient spawn [name]
/playerclient spawn [name] offset [x] [y] [z] 保存した情報はconfig/EssentialClient/PlayerClient.jsonに保存されている。 例 { "steve": { "x": 0.5, "y": 73.0, "z": 0.5, "yaw": 0.0, "pitch": 0.0, "dimension": "overworld", "gamemode": "creative" }
}
